import React, { Component } from "react";
import Logo from "../../../assets/logo.svg";

import { Container, Form, Label, TextTerms, Error } from "./styles";
import Input from "../../../components/Input";
import Button from "../../../components/Button";

export default class CreateFisicalPerson extends Component {
  state = {
    nome: "Gabriel",
    sobrenome: "Luiz",
    rg: "",
    orgao: "",
    uf: "",
    nascimento: "",
    cpf: "",
    email: "",
    telefone: "",
    senha: "",
    errorMessage: false
  };

  handleChange = ev => {
    this.setState({
      [ev.target.name]: ev.target.value
    });
  };

  handleSubmit = ev => {
    ev.preventDefault();

    if (this.state.rg.length < 9) {
      this.setState({
        errorMessage: true
      });
    } else {
      this.setState({
        errorMessage: false
      });
    }

    if (this.state.cpf.length < 11) {
      this.setState({
        errorMessage: true
      });
    } else {
      this.setState({
        errorMessage: false
      });
    }

    this.setState({
      nome: "",
      sobrenome: "",
      rg: "",
      orgao: "",
      uf: "",
      nascimento: "",
      cpf: "",
      email: "",
      telefone: "",
      senha: ""
    });
  };

  render() {
    return (
      <Container>
        <Form onSubmit={this.handleSubmit} withError={this.state.isError}>
          <img src={Logo} alt="Osc-logo" />
          <Label>
            <p>Nome:</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.nome}
              placeholder="Nome"
              name="nome"
            />
          </Label>

          <Label>
            <p>Sobrenome:</p>
            <Input
              type="text"
              onChange={this.handleChange}
              value={this.state.sobrenome}
              placeholder="Sobrenome"
              name="sobrenome"
            />
          </Label>
          <span>
            <Label>
              <p>rg</p>
              <Input
                type="number"
                onChange={this.handleChange}
                value={this.state.rg}
                placeholder="000000-0"
                name="rg"
              />
              {this.state.errorMessage && <Error>RG invalido</Error>}
            </Label>
            <Label>
              <p>Orgão expedidor</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.orgao}
                name="orgao"
              />
            </Label>
          </span>
          <span>
            <Label>
              <p>uf</p>
              <Input
                type="text"
                onChange={this.handleChange}
                value={this.state.uf}
                name="uf"
              />
            </Label>
            <Label>
              <p>data de nascimento</p>
              <Input
                type="number"
                onChange={this.handleChange}
                value={this.state.nascimento}
                placeholder="02/01/2020"
                name="nascimento"
              />
            </Label>
          </span>
          <Label>
            <p>cpf</p>
            <Input
              type="number"
              onChange={this.handleChange}
              value={this.state.cpf}
              placeholder="000000-0"
              name="cpf"
            />
          </Label>
          <Label>
            <p>email</p>
            <Input
              type="email"
              onChange={this.handleChange}
              value={this.state.email}
              name="email"
            />
          </Label>
          <Label>
            <p>telefone</p>
            <Input
              type="tel"
              onChange={this.handleChange}
              value={this.state.telefone}
              placeholder="(00) 00000-0000"
              name="telefone"
            />
          </Label>
          <Label>
            <p>senha</p>
            <Input
              type="password"
              onChange={this.handleChange}
              value={this.state.senha}
              placeholder="Inserir senha"
              name="senha"
            />
          </Label>
          <span>
            Clique abaixo para concordar com os{" "}
            <strong>Termos de Serviço</strong> e registrar.
          </span>
          <Button
            text="concordar e criar conta"
            type="button"
            onCliick={this.handleSubmit}
          />
        </Form>
      </Container>
    );
  }
}
